import Card from '../Card/Card';
import './Country.css';
import { useSelector } from 'react-redux';

const Country = () => {
    const countries = useSelector(state => state.countries);
    return (
        <div>
        {countries.map(char => {  
              return <Card
              id={char.id} 
              name={char.name}
              flag={char.flag}
              continent={char.continent}
   
            />
             })}
            </div>
) }

export default Country;
